// ==UserScript==
// @name            TWFR-5EME-ANNIV
// @description     Just a Joke for the TW FR 5th anniversary
// @include     http://*.the-west.fr/game.php*
// @version     1.0.2
// @nocompat Chrome
// @grant       none 
// ==/UserScript==
//
(function(e) {
	var t = document.createElement("script");
	t.type = "application/javascript";
	t.textContent = "(" + e + ")();";
	document.body.appendChild(t);
	t.parentNode.removeChild(t);
})
		(function() {
			if (/http:\/\/.+\.the-west\..*\/game\.php.*/
					.test(window.location.href)) {

				TWZ = {
					
					MenuBox : {
						 
						create : function() { 

							$('#TWZ_Icon').remove();
							var a = $('<div></div>').attr({
								'class' : 'menulink',
								'title' : 'Happy Birthday TW FR'
							}).css({
							'background-image': "url('data:image/gif;base64,')",
                    	    'background-size': '25px 25px'
							})
							.click(function(e) {
								TWZ.MenuBox.open(e);
							}); 
							 
							var b = $('<div></div>').attr({
								'class' : 'menucontainer_bottom'
							}); 
							
							var t1 = $("#ui_menubar"),
									t2 = $('<div class="ui_menucontainer"><div id="TWT_Icon"></div><div class="menucontainer_bottom"></div></div>');
							t1.append(t2.append(a).append(b));
							 
						},
						open : function(e) {
						
							this.Window = wman.open('WindowInvit',
									"Invitation des 5 ans de TW France").setMiniTitle(
									"Invitation des 5 ans de TW France").addClass(
									'tw2gui_window_notabs');

							var midPane = $('<div id="midPane"/>').css({
								'height' : '100%',
    							'background-image': 'url("data:image/png;base64,")',
    							'position' : 'absolute',
								 'background-position': 'center center',
								'height' : '235px',
								'top' : '185px',
								'width' : '100%',
								'background-repeat':'no-repeat',
								'font-family': 'comic sans ms','font-size': '14pt','padding-top':'10px','text-align': 'center'
							});
							
							var topPane = $('<div id="topPane" />').css({ 
								'position' : 'absolute',
								'background-image' : 'url("http://img11.hostingpics.net/pics/526884TW444422222222.png")',
								'height' : '185px',
								'width' : '100%',
								'top' : '0px'
							});
 

                        	var bottom = $('<div id="bottom" />').css({ 
								'position' : 'absolute',
								'width' : '100%',
								'top' : '340px'
							});
							
							$('<div id="WindowInvitBody" />')
									.append(topPane) 
									.append(midPane)
								    .append(bottom)
									.appendTo(
											'.WindowInvit .tw2gui_window_content_pane');
											
							this.Window.showLoader();
							
					 		$('#midPane').append("Venez nombreux nous rejoindre <a href=\"http://forum.the-west.fr/showthread.php?t=30305\" target=\"_blanck\">sur le forum</a> pour participer aux nombreuses animations et fter le 5me anniversaire de The West France");
				    	 
				        	$('#bottom').append(TWZ.getDunMp());
					      
					      this.Window.hideLoader();  
 
				 			
						
						}
					}, 
					getDunMp : function() {

								return "<div style='text-align:right;padding-right: 5px; padding-top: 15px;'>"+
								"<a href=\"http://forum.the-west.fr/member.php?u=7385\" target=\"_blanck\">by Dun</a></div>";

						 
					}
						 

			}
			
				                    var that = this;
			                        this.interval = setInterval(
									function() {

										var loading = false;

										if (isDefined(Character.playerId)
												&& Character.playerId == 0) {
											loading = false;
										} else if (isDefined(ItemManager.initialized)
												&& !ItemManager.initialized) {
											loading = false;
										} else if (isDefined(ItemManager.isLoaded)
												&& !ItemManager.isLoaded()) {
											loading = false;
										}   else {

											loading = true;

										}
										console.log(loading);
										if (loading) {
											  clearInterval(that.interval);
                                              TWZ.MenuBox.create();
  
										}

									}, 500);
			
			
			
			
	}
	});
       